import logo from './logo.svg';
import Navbar, { Container } from 'react-bootstrap/Navbar'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
         <Navbar>
            <Container>
                <Navbar.Brand>amazona</Navbar.Brand>
            </Container>
         </Navbar>
      </header>
    </div>
  );
}

export default App;
